  true,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains information about
  the biomass resources generated by county in the United States. It includes the
  following feedstock categories: crop residues, forest residues, primary mill residues,
  secondary mill residues, and urban wood waste.nnThe estimates are based on county-level
